import React, { Component } from 'react'

import signUp from './index.module.css'


export default class SignUp extends Component {
    constructor(props) {
        super(props)
        this.state = {
            userIDInvalid: false,
            userID: '',
            userName: '',
            password: '',
        }
    }


    render() {
        const { userIDInvalid } = this.state;
        return (
            <div >
                <form className={signUp.pageContainer} action="">
                    <div className={signUp.userInfo} >账号</div>
                    <input className={userIDInvalid ? signUp.userInputInvalid : signUp.userInput} placeholder="邮箱或ID" type="text" onBlur={(e) => this.handleBlur(e, 'id')} />
                    <div className={signUp.userInfo} >密码</div>
                    <input className={signUp.userInput} placeholder="您的密码" type="text" onBlur={(e) => this.handleBlur(e, 'name')}/>
                    <div className={signUp.userInfo}>确认密码</div>
                    <input className={signUp.userInput} placeholder="与上方一致" type="password" onBlur={(e) => this.handleBlur(e, 'password')} />
                    <input className={signUp.signUpButton} type="button" value="SignUp" onClick={(e)=>this.handleRegisterClick(e)}/>
                </form>
            </div>
        )
    }
}
